class SolutionA(object):
    def maximalNetworkRank(self, n, roads):
        """
        :type n: int
        :type roads: List[List[int]]
        :rtype: int
        """
        
        a = []
        
        for i in range(n):a.append([])
        
        for i in roads:
            a[i[0]].append(i[1])
            a[i[1]].append(i[0])
        
        #for i in range(n): print(i,a[i])
            
        max_res = 0
        res_buffer = 0
        for i in range(n):
            for j in range(i+1,n):
                res_buffer = 0
                res_buffer = len(a[i]) + len(a[j])
                #rint(len(a[i]) , len(a[j]))
                if i in a[j]: res_buffer = res_buffer - 1
                if res_buffer > max_res: max_res = res_buffer

        return max_res

# 320 ms, 52.02%,15 MB, 20.23% 
class SolutionB(object):
    def maximalNetworkRank(self, n, roads):
        """
        :type n: int
        :type roads: List[List[int]]
        :rtype: int
        """
        
        a = []
        link_table = []
        for i in range(n):
            a.append(0)
            link_table.append([])
            for j in range(n): link_table[i].append(0)
        
        for i in roads:
            a[i[0]] = a[i[0]] + 1
            a[i[1]] = a[i[1]] + 1
            link_table[i[0]][i[1]] = 1
            link_table[i[1]][i[0]] = 1
        
        for i in range(n): 
            print(link_table[i])
            
        max_res = 0
        res_buffer = 0
        for i in range(n):
            for j in range(i+1,n):
                res_buffer = 0
                res_buffer = a[i] + a[j] - ( 1 if link_table[i][j] == 1 else 0 )
                if res_buffer > max_res: max_res = res_buffer

        return max_res


